import React from "react";
import './styles.css';

class Cadastro extends React.Component {
    render() {
        return (
            <div className="background-black d-flex align-items-center justify-content-center vh-100">
                <div className="container-cadastro background-light-gray text-black">
                    <div className="jumbotron">
                        <h1 className="display-4">Hello, world!</h1>
                        <p className="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
                        <hr className="my-4" />
                        <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
                        <button className="btn btn-purple w-25 py-2 button-with-border text-white" type="submit">Oi</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Cadastro;
